namespace RonSijm.FluidHumidifier.Factories.Bedrock;

public class InnerDataSourceDataSourceConfigurationFactory(Action<Humidifier.Bedrock.DataSourceTypes.DataSourceConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.Bedrock.DataSourceTypes.DataSourceConfiguration>
{

    internal InnerDataSourceS3DataSourceConfigurationFactory S3ConfigurationFactory { get; set; }

    internal InnerDataSourceSalesforceDataSourceConfigurationFactory SalesforceConfigurationFactory { get; set; }

    internal InnerDataSourceConfluenceDataSourceConfigurationFactory ConfluenceConfigurationFactory { get; set; }

    internal InnerDataSourceSharePointDataSourceConfigurationFactory SharePointConfigurationFactory { get; set; }

    internal InnerDataSourceWebDataSourceConfigurationFactory WebConfigurationFactory { get; set; }

    protected override Humidifier.Bedrock.DataSourceTypes.DataSourceConfiguration Create()
    {
        var dataSourceConfigurationResult = CreateDataSourceConfiguration();
        factoryAction?.Invoke(dataSourceConfigurationResult);

        return dataSourceConfigurationResult;
    }

    private Humidifier.Bedrock.DataSourceTypes.DataSourceConfiguration CreateDataSourceConfiguration()
    {
        var dataSourceConfigurationResult = new Humidifier.Bedrock.DataSourceTypes.DataSourceConfiguration();

        return dataSourceConfigurationResult;
    }
    public override void CreateChildren(Humidifier.Bedrock.DataSourceTypes.DataSourceConfiguration result)
    {
        base.CreateChildren(result);

        result.S3Configuration ??= S3ConfigurationFactory?.Build();
        result.SalesforceConfiguration ??= SalesforceConfigurationFactory?.Build();
        result.ConfluenceConfiguration ??= ConfluenceConfigurationFactory?.Build();
        result.SharePointConfiguration ??= SharePointConfigurationFactory?.Build();
        result.WebConfiguration ??= WebConfigurationFactory?.Build();
    }

} // End Of Class

